import React from "react";
import "./collection.styles.scss";
import CollectionItem from "../../components/collection-item/collection-item.component";
import { useSelector } from "react-redux";
import { selectCollection } from '../../redux/directory/dataShop.selector';

export default function CollectionPage({match}) {
    console.log(match.params.collectionId);

  const items = useSelector(selectCollection(match.params.collectionId));

  console.log(items);

  return (
    <div className="collection-item">
      {items
        .map((item) => (         
          <CollectionItem key={item.id} item={item.items.map(item => item)} />
        ))}
    </div>
  );
}
